import React, { Component } from "react";
import "./Login-Register.css";

export default class Register extends Component {
                 constructor(props) {
                   super(props);
                   this.state = {
                     email: "",
                     password: "",
                     firstName: "",
                     lastName: "",
                   };
                 }

                 handleEmailChange(e) {}

                 handleEmailChange(e) {}

                 handleEmailChange(e) {}

                 handleEmailChange(e) {}

                 render() {
                   var sentBack = false;
                   return (
                     <div className="Register py-5 px-4">
                       {/* <h1>LOGO</h1>
        <br />
        <br /> */}
                       <h5 style={{ fontWeight: "600" }}>
                         Create your account
                       </h5>
                       <br />
                       <br />
                       <div className="w-100 text-center">
                         Sign up with Google
                       </div>
                       <br />
                       <div className="or-separator my-2 w-100 text-center font-grey">
                         <span className="px-1">or</span>
                       </div>

                       <form className="font-grey font-small-login-reg">
                         <label
                           htmlFor="login-email-input"
                           style={{ fontWeight: "500" }}
                         >
                           Email Address{" "}
                         </label>
                         <div className="input-group input-group-sm mb-3">
                           <input
                             type="email"
                             className={"form-control form-control-sm"}
                             id="login-email-input"
                             aria-describedby="emailHelp"
                             // onChange={(e) => this.handleEmailInput(e)}
                             // onKeyDown={(e) => this.handleEmailEnter(e)}
                           />
                           {/* <div className={"input-group-append"}>
              <span className="input-group-text email-check">
                <i className="fas fa-check"></i>
              </span>
            </div> */}

                           {/* <small id="emailHelp" className="form-text text-muted">
              This is your email address you used when you registered.
            </small> */}
                         </div>
                         <label
                           htmlFor="login-firstName-input"
                           style={{ fontWeight: "500" }}
                         >
                           First Name{" "}
                         </label>
                         <div className="input-group input-group-sm mb-3">
                           <br></br>
                           <input
                             type="text"
                             className={"form-control form-control-sm "}
                             id="login-firstName-input"
                             aria-describedby="emailHelp"
                             // onChange={(e) => this.handleEmailInput(e)}
                             // onKeyDown={(e) => this.handleEmailEnter(e)}
                           />
                           {/* <div className={"input-group-append"}>
              <span className="input-group-text email-check">
                <i className="fas fa-check"></i>
              </span>
            </div> */}
                         </div>
                         <label
                           htmlFor="login-lastName-input"
                           style={{ fontWeight: "500" }}
                         >
                           Last Name{" "}
                         </label>
                         <div className="input-group input-group-sm mb-3">
                           <br></br>
                           <input
                             type="text"
                             className={"form-control form-control-sm"}
                             id="login-lastName-input"
                             aria-describedby="emailHelp"
                             // onChange={(e) => this.handleEmailInput(e)}
                             // onKeyDown={(e) => this.handleEmailEnter(e)}
                           />
                           {/* <div className={"input-group-append"}>
              <span className="input-group-text email-check">
                <i className="fas fa-check"></i>
              </span>
            </div> */}
                         </div>
                         <div className={"form-group"}>
                           <label
                             htmlFor="login-password-input"
                             style={{ fontWeight: "500" }}
                           >
                             Password
                           </label>
                           <input
                             type="password"
                             className={
                               "form-control form-control-sm" +
                               (sentBack ? " border-danger" : "")
                             }
                             id="login-password-input"
                             // onChange={(e) => this.handlePasswordInput(e)}
                             ref={this.passwordInput}
                           />
                         </div>
                         <br />
                         <br />

                         <button
                           className="btn btn-primary px-4"
                           type={this.state.nextClicked ? "submit" : "button"}
                           disabled={!this.state.usernameEntered}
                           onClick={(e) => this.handleLoginBtnClick(e)}
                         >
                           {"Sign Up"}
                         </button>

                         <span className="ml-3 font-small-login-reg">
                           Already have an account?{" "}
                           <span
                             onClick={() => {
                               this.props.switchToLogin();
                             }}
                             className="text-primary toggle-prompt-text"
                             style={{ cursor: "pointer" }}
                           >
                             Log In
                           </span>
                         </span>
                       </form>
                     </div>
                   );
                 }
               }
